import React from 'react';
import Header from './components/Header';
import Footer from './components/Footer';


function App() {
	return (
		<React.Fragment>
			<Header />
			<main>
				<h1>Ecommerce App</h1>
			</main>
			<Footer />
		</React.Fragment>
	);
}

export default App;
